# Introduction to interactive visualization

---

## What is interactive visualization?

- Interactive visualization involves the creation and sharing of interactive data objects

- Interactive data objects are graphical representations of data, model, or results that allow a user to directly manipulate and explore

- Some example products and packages in R:
--

  - Interactive plots (`Plotly`)
  
  - Interactive maps (`plotly`, `Leaflet`)
  
  - Interactive tables (`formattable`, `as.datatable`)
  
  - Dashboards (`flexdashboard`)
  
  - Interactive applications (`shiny`)
  
  - Websites (Static using `R Markdown`, `blogdown`, `Hugo`, `Jeckyll`)

---

## What is interactive visualization (cont'd)

- Interactivity allows users to engage with data, a model, algorithm, or other visualization in a way that static visuals cannot

- Features of interactivity include: 
--
  
  - Identify, isolate, and visualize information for extended periods of time 

  - Zoom in and out

  - Highlight relevant information
    
  - Get more information
  
  - Filter
    
  - Animate
  
  - Change parameters

---

# Why use interactive visualization?

  - In this course we’ve covered visualization and in particular how `ggplot()` can help to make static plots with many dimensions

  - But what if you want to explore a third or fourth dimension of data -- quickly? Or without all the noise? Or identify strange values?

  - Or, what if you want to communicate your findings to an external audience? Specifically, if you want that audience to engage with or explore the data?

Interactive visualization helps with both the **exploration** and **communication** parts of the data science process

## Interactive Visualization for **exploratory data analysis** (EDA)

- Interactive graphics are well suited to aid the exploration of high-dimensional or otherwise complex data

- Interacting with information in a visual way helps to enable insights that wouldn’t be easy or even possible with static graphics, for reasons including:

--
  - **Investigate faster**: In a true exploratory setting, you have to make lots of visualizations, and investigate lots of follow-up questions, before stumbling across something truly valuable. Interactive visualization can aid in the sense-making process by searching for information quickly without fully specified questions (Unwin and Hofmann 1999)

--

  - **Identifying relationships or structure that would otherwise go missing** (J. W. Tukey and Fisherkeller 1973)

--

  - **Understand and diagnose problems with data, models, or algorithms** (Wickham, Cook, and Hofmann 2015)

---

## Interactive Visualization for **EDA** (cont'd)

  - In a true exploratory setting, you have to make lots of visualizations, and investigate lots of follow-up questions, before stumbling across something truly valuable

  - Although interactivity can augment EDA, it’s typically only *practical* when we can create and alter visuals quickly

  - Plotly and Leaflet are well suited to these tasks -- they make the added effort required to enable functionality relatively small

## What is Plotly?

&lt;div style="text-align: center;"&gt;
  &lt;figure&gt;
    &lt;img style="width: 50px;vertical-align: middle;"  hspace="20px" src="img/plotly.png" alt="Plotly"

  - Plotly is a web application for creating and sharing interactive graphics

  - Is powered by JavaScript graphing library plotly.js and is designed on principles of adding layers

  - Plotly can work with several programming languages and applications including R, JavaScript,
Python, Matlab, and Excel.

## Install Plotly

Installing Plotly is easy


```r
install.packages("plotly")
library(plotly)
```

## `plot_ly()` vs. `ggplotly()`

- There are two main ways to create a plotly object:

  - Transforming a `ggplot2` object (via `ggplotly()`) into a plotly object 

  - Directly initializing a plotly object with `plot_ly()`/`plot_geo()`/`plot_mapbox()`
  
- Both approaches are powered by the JavaScript graphing library plotly.js so many of the same concepts and tools that you learn for one interface can be reused in the other

---

## `plot_ly()`

- Any graph made with the **plotly** R package is powered by the JavaScript library [plotly.js](https://github.com/plotly/plotly.js) 

- The `plot_ly()` function provides a 'direct' interface to plotly.js with some additional abstractions to help reduce typing. 

- If we assign variable names (e.g., `cut`, `clarity`, etc.) to visual properties (e.g., `x`, `y`, `color`, etc.), `plot_ly()` tries to find a sensible geometric representation of that information for us

--- 

## `plot_ly()`


```r
plot_ly(diamonds, x = ~cut, y = ~clarity)
```

## `plot_ly()` functionality

The `plot_ly()` function has numerous arguments that are unique to the R package (e.g., `color`, `stroke`, `span`, `symbol`, `linetype`, etc.) and make it easier to encode data variables (e.g., diamond clarity) as visual properties (e.g., color). By default, these arguments map values of a data variable to a visual range defined by the plural form of the argument. 

In this example, `color` is used to map each level of diamond clarity to a different color. Then, `colors` is used to specify the range of colors (which, in this case, the `"Accent"` color palette from the **RColorBrewer** package, but one can also supply custom color codes or a color palette function like `colorRamp()`).

---

## `plot_ly()` functionality


```r
plot_ly(diamonds, x = ~cut, color = ~clarity, colors = "Accent")
```

## `layout()` 

- (almost) every function anticipates a **plotly** object as input to its first argument and returns a modified version of that **plotly** object. 

- For example, the `layout()` function anticipates a **plotly** object in its first argument and its other arguments add and/or modify various layout components of that object (e.g., the title):

---

## `layout()` 


```r
layout(
  plot_ly(diamonds, x = ~cut),
  title = "My beatiful histogram"
)
```

## `layout()` 

or using the `%&gt;%` operator from the **magrittr** package:


```r
diamonds %&gt;%
  plot_ly(x = ~cut) %&gt;%
  layout(title = "My beatiful histogram")
```

--- 

## Layers and `add_*()` 

- In addition to `layout()` for adding/modifying part(s) of the graph's layout, there are also a family of `add_*()` functions (e.g., `add_histogram()`, `add_lines()`, etc.) that define how to render data into geometric objects. 

- These functions add a graphical layer to a plot. A *layer* can be thought of as a group of graphical elements that can be sufficiently described using only 5 components: 

  - data
  - aesthetic mappings (e.g., assigning `clarity` to `color`)
  - a geometric representation (e.g., rectangles, circles, etc.)
  - statistical transformations (e.g., sum, mean, etc.)
  - positional adjustments (e.g., dodge, stack, etc.). 

---


## Layers and `add_*()` 

Let's add an `add_histogram()` layer:


```r
diamonds %&gt;%
  plot_ly() %&gt;% 
  add_histogram(x = ~cut)
```

## Basic Scatterplot

A basic scatterplot is easy to make, with the added benefit of tooltips that
appear when your mouse hovers over each point. Specify a scatterplot by
indicating `type = "scatter"`. Notice that the arguments for the `x` and `y` 
variables as specified as formulas, with the tilde operator (`~`) preceding the
variable that you're plotting.



```r
library(plotly)
plot_ly(mtcars, x = ~wt, y = ~mpg, type = "scatter")
```

## Scatterplot Color

You can add color to your scatterplot points according to a categorical variable
in the data frame you use with `plot_ly()`.


```r
plot_ly(mtcars, x = ~wt, y = ~mpg, type = "scatter", color = ~factor(cyl))
```

## 3D Scatterplot

You can create a three-dimensional scatterplot with the `type = "scatter3d"`
argument. If you click and drag these scatterplots you can view them from
different angles.


```r
set.seed(2016-07-21)
temp &lt;- rnorm(100, mean = 30, sd = 5)
pressue &lt;- rnorm(100)
dtime &lt;- 1:100
plot_ly(x = ~temp, y = ~pressue, z = ~dtime,
        type = "scatter3d", color = ~temp)
```

## Line Graph

Line graphs are the default graph for `plot_ly()`. They're of course useful for
showing change over time:


```r
data("airmiles")
plot_ly(x = ~time(airmiles), y = ~airmiles, type = "scatter", mode = "lines")
```

## Multi Line Graph

You can show multiple lines by specifying the column in the data frame that
separates the lines:


```r
library(plotly)
library(tidyr)
library(dplyr)
data("EuStockMarkets")

stocks &lt;- as.data.frame(EuStockMarkets) %&gt;%
  gather(index, price) %&gt;%
  mutate(time = rep(time(EuStockMarkets), 4))

plot_ly(stocks, x = ~time, y = ~price, color = ~index, type = "scatter", mode = "lines")
```

`type = "histogram"` argument.


```r
plot_ly(x = ~precip, type = "histogram")
```

## Boxplot

Boxplots are wonderful for comparing how different datasets are distributed.
Specify `type = "box"` to create a boxplot.


```r
plot_ly(iris, y = ~Petal.Length, color = ~Species, type = "box")
```

## Heatmap

Heatmaps are useful for displaying three dimensional data in two dimensions,
using color for the third dimension. Create a heatmap by using the
`type = "heatmap"` argument.


```r
terrain1 &lt;- matrix(rnorm(100*100), nrow = 100, ncol = 100)
plot_ly(z = ~terrain1, type = "heatmap")
```

## 3D Surface

Why limit yourself to two dimensions when you can render three dimensions on a
computer!? Create moveable 3D surfaces with `type = "surface"`.


```r
terrain2 &lt;- matrix(sort(rnorm(100*100)), nrow = 100, ncol = 100)
plot_ly(z = ~terrain2, type = "surface")
```

## Choropleth Maps: Setup

Choropleth maps illustrate data across geographic areas by shading regions with
different colors. Choropleth maps are easy to make with Plotly though they
require more setup compared to other Plotly graphics.


```r
# Create data frame
state_pop &lt;- data.frame(State = state.abb, Pop = as.vector(state.x77[,1]))
# Create hover text
state_pop$hover &lt;- with(state_pop, paste(State, '&lt;br&gt;', "Population:", Pop))
# Make state borders white
borders &lt;- list(color = toRGB("red"))
# Set up some mapping options
map_options &lt;- list(
  scope = 'usa',
  projection = list(type = 'albers usa'),
  showlakes = TRUE,
  lakecolor = toRGB('white')
)
```

---

## Choropleth Maps: Mapping


```r
plot_ly(z = ~state_pop$Pop, text = ~state_pop$hover, locations = ~state_pop$State, 
        type = 'choropleth', locationmode = 'USA-states', 
        color = state_pop$Pop, colors = 'Blues', marker = list(line = borders)) %&gt;%
  layout(title = 'US Population in 1975', geo = map_options)
```

# `ggplotly()`

- So far we've focused on `plot_ly()`. We also have the option of working with `ggplotly()` function from the **plotly** package, which has the ability to translate **ggplot2** to **plotly**. 

- This functionality can be really helpful for quickly adding interactivity to your existing **ggplot2** workflow.

- Moreover, even if you know `plot_ly()` and plotly.js well, `ggplotly()` can still be desirable for creating visualizations that aren't necessarily straightforward to achieve without it. 

--- 

## `ggplotly()`

To demonstrate, let's explore the relationship between `price` and other variables from the well-known `diamonds` dataset. 

Hexagonal binning (i.e., `geom_hex()`) is useful way to visualize a 2D density, like the relationship between `price` and `carat`. We can see there is a strong positive linear relationship between the _log_ of carat and price. It also shows that for many, the carat is only rounded to a particular number (indicated by the light blue bands) and no diamonds are priced around $1500. Making this plot interactive makes it easier to decode the hexagonal colors into the counts that they represent.


```r
p &lt;- ggplot(diamonds, aes(x = log(carat), y = log(price))) + 
  geom_hex(bins = 100)
ggplotly(p)
```

--- 

## `ggplotly()` for statistical summaries

We may use `ggplotly()` over `plot_ly()` to leverage **ggplot2**'s consistent and expressive interface for exploring statistical summaries across groups. For example, by including a discrete `color` variable (e.g., `cut`) with `geom_freqpoly()`, you get a frequency polygon for each level of that variable. This ability to quickly generate visual encodings of statistical summaries across an arbitrary number of groups works for basically any geom (e.g., `geom_boxplot()`, `geom_histogram()`, `geom_density()`, etc.) and is a key feature of **ggplot2**.


```r
p &lt;- ggplot(diamonds, aes(x = log(price), color = clarity)) + 
    geom_freqpoly()
ggplotly(p)
```

--- 

## `ggplotly()` for statistical summaries

Now, to see how `price` varies with both `cut` and `clarity`, we could repeat this same visualization for each level of `cut`. This is where **ggplot2**'s `facet_wrap()` comes in handy. Moreover, to facilitate comparisons, we can have `geom_freqpoly()` display relative rather than absolute frequencies. By making this plot interactive, we can more easily compare particular levels of clarity (as shown in Figure \@ref(fig:freqpoly-facet)) by leveraging the legend filtering capabilities. 


```r
p &lt;- ggplot(diamonds, aes(x = log(price), color = clarity)) + 
    geom_freqpoly(stat = "density") + 
    facet_wrap(~cut)
ggplotly(p)
```
